import './index.css'
import Item from '../Item'
export default class Header extends Component {
    render(){
        return(

                <ul className="todo-main">
				{
					todos.map( todo =>{
						return <Item key={todo.id} {...todo} updateTodo={updateTodo} deleteTodo={deleteTodo}/>
					})
				}
			</ul>

        )
    }
}
